import initialState from './initialState';
import {LOGIN_SUCCESS,LOGIN_FAILED} from '../types/authTypes';
const authReducers = (state = initialState.authError, action) => {
    switch(action.type) {
        case LOGIN_SUCCESS:
            console.log('login success');
            return {
                ...state,
                authError:'login'
            }
    }
}
export default authReducers;
